I_{jj'}(\theta,\theta',{\bf q},{\bf q}') = i{1\over 2[C^{2}_{j}(\theta,\theta',{\bf q})
-C^{2}_{j'}(\theta,\theta',{\bf q}')]}\left ( {C_{j}(\theta,\theta',{\bf q})
e^{C_{j}(\theta,\theta',{\bf q})}\over [e^{C_{j}(\theta,\theta',{\bf q})}-1]^{2}}
-{C_{j'}(\theta,\theta',{\bf q}')e^{C_{j'}(\theta,\theta',{\bf q}')}\over
[e^{C_{j'}(\theta,\theta',{\bf q}')}-1]^{2}}\right ).
\end{equation}

